import React from 'react';
import Topbar from './Topbar';
import Menu from './Menu';
import Banner from './Banner';
import Frame69 from './Frame69';
import Frame130 from './Frame130';
import Frame71 from './Frame71';
import Frame72 from './Frame72';
import Frame75 from './Frame75';
import Frame70 from './Frame70';
import Frame128 from './Frame128';
import Frame129 from './Frame129';
// import other frames/components as needed

function Homepage() {
  return (
    <div
      style={{
        width: '100%',
        maxWidth: '1440px',
        margin: '0 auto',
        boxSizing: 'border-box',
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
      }}
    >
      <Topbar />
      <Menu />
      <Banner />
      <Frame69 />
      <Frame130 />
      <Frame71 />
      <Frame72 />
      <Frame75 />
      <Frame70 />
      <Frame128 />
      <Frame129 />
      {/* Add other frames/components here as you implement them */}
    </div>
  );
}

export default Homepage;
